import PropTypes from 'prop-types'
import { Link } from 'react-router-dom'

const User = ({user, getUserBlog}) => {
    return (
        <div>
            <Link to={`/user/${user.id}`}>{user.username} {onClick=getUserBlog(user.id)}</Link> {user.blogs.length}
        </div>
    )
}

User.propTypes = {
    user: PropTypes.object
}

export default User
